import { Fragment } from "react";

function NavItem({title, url}){
    return (
      <a href={url}>
      {title}
      </a>
      );
  }

  function Logo({logo, size}){
    return(
      <img 
      src={logo}
      width={size}
      height={size}
      />
    )
  }

  export default function NavbarAccordian(){
    return (
        <Fragment>
            <div className="accordian">
                <div className="flex flex-row justtify-between">
                    <Logo logo={"https://u.cubeupload.com/bostonessary/phunkplain.png"} size={50}/>
                    <img src="https://svgshare.com/i/t84.svg" width={50} height={50}/>
                </div>


                <div className="accordian-symbol flex justify-end">

                </div>
                <div id="accordian-items" className="flex flex-col h-screen ">
                    <NavItem title="Home" url=""/>
                    <NavItem title="Blogs" urls=""/>
                    <NavItem title="Reviews" urls=""/>
                    <NavItem title="Podcasts" urls=""/>
                </div>
            </div>
        </Fragment>
    )
}

  function Navbar({}) {
    return (
      <nav className="flex justify-between"> 
        <div>
            <Logo logo={"https://u.cubeupload.com/bostonessary/phunkplain.png"} size={50}/>
        </div>
        <div className="flex justify-between">
        <NavItem title={"Home"} url={""}/>
        <NavItem title={"Blog"} url={""}/>
        <NavItem title={"Reviews"} url={""}/>
        <NavItem title={"Podcasts"} url={""}/>
        </div>
     </nav>
    );
}
